import React, { Component } from 'react';
import axios from 'axios';
import './Blog.css';
import { Route } from 'react-router-dom';
import Posts from '../Blog/Posts/Posts';

class Blog extends Component {
  render() {
    return (
      <div className="Blog">
        <header>
          <nav>
            <ul>
              <li>
                <a href="/">Home</a>
                <li>
                  <a href="/new-post">New Post</a>
                </li>
              </li>
            </ul>
          </nav>
        </header>
        <Route />
      </div>
    );
  }
}

export default Blog;
